function changeStyle(n,t,e,o){if("id"==n){var r="'"+t+"'",l="'"+o+"'";document.getElementById(r).style.style=l}else if("class"==n){var s="'"+t+"'";l="'"+o+"'";document.getElementsByClassName(s).style.style=l}}function hide(n,t){var e="'"+t+"'";"id"==n?document.getElementById(e).style.display="none":"class"==n&&(document.getElementsByClassName(e).style.display="none")}function show(n,t){var e="'"+t+"'";"id"==n?document.getElementById(e).style.display="block":"class"==n&&(document.getElementsByClassName(e).style.display="block")}function convert(n,t,e){if("fahren"==n){if("centi"==e)return 5/9*(t-32);if(e="kelvin")return 5/9*(t-32)+273.15;console.log("Error! You either didn't provide a conversion for post results or you provided an invalid one.")}}function pi(){return Math.PI}function round(n){return Math.round(n)}function sqrt(n){return Math.sqrt(n)}function randomNum(n,t){return Math.floor(Math.random()*(t-n+1))+n}function startDebug(){onerror=handleErr}function handleErr(n,t,e){txt="Error. \n\n",txt+="Error: "+n+"\n",txt+="URL: "+t+"\n",txt+="Line: "+e+"\n\n",console.log(txt)}
